  `insert_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updater` int(11) NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
