  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `itemCode`(`item_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 20 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '当前使用的事项信息' ROW_FORMAT = Compact;

